import React from "react";
import {
  MDBFooter,
  MDBContainer,
  MDBCol,
  MDBRow,
  MDBIcon,
  MDBBtn,
} from "mdb-react-ui-kit";
import { Col, Container, Row } from "react-bootstrap";
import { SlSocialGoogle, SlSocialLinkedin } from "react-icons/sl";
import { FiGithub, FiPhone, FiMessageCircle } from "react-icons/fi";
export default function App() {
  return (
    <MDBFooter className="myBlackDarkBg myTextWhite my-5 text-center text-white ">
      <p className="display-3"> Contattami</p>
      <MDBContainer className="p-4 pb-0">
        <Row>
          {" "}
          <Col></Col>
          <Col></Col>
          <Col
            className="d-flex flex-column
           "
          >
            <div>
              <FiGithub /> @leonardoantonelli{" "}
            </div>
            <div>
              <FiMessageCircle /> antonellileonardodesign@gmail.com{" "}
            </div>
            <FiPhone />
            <p> 3285405551</p>
          </Col>
        </Row>
      </MDBContainer>
    </MDBFooter>
  );
}
